import {
  Button,
  Box
} from "@mui/material";
const MaterialUi = ()=>{
  const design = (
    <>
      <Button
          variant="contained"
          color="secondary"
          sx={{
            "&:hover":{
              background: "red"
            },
            "&:focus":{
              background: 'yellow'
            }
          }}
          >
          Submit
      </Button>
      <Box sx={{
        width:"300px",
        height:"200px",
        background: "red",
        m:4,
        textAlign: "center",
        "&:hover":{
          color:"white",
          background: "black",
          fontSize: "30px"
        }
      }}>HELLO INDIA
      </Box>
    </>
  )
  return design;
}

export default MaterialUi;
